def function (row):
    if row ['spm_incneeds_tc'] <= 0.5:
        return "Below 50% Poverty Line"
    elif row ['spm_incneeds_tc'] <= 1:
        return "50-100% Poverty Line"
    elif row ['spm_incneeds_tc'] <= 2:
        return "100-200% Poverty Line"
    elif row ['spm_incneeds_tc'] <= 3:
        return "200-300% Poverty Line"
    elif row ['spm_incneeds_tc'] <= 4:   
        return "300-400% Poverty Line"
    else:
        return "400% Poverty Line and Above"

df ["Poverty Line"] = df.apply (function, axis=1)
